//延迟方法，避免连续输入卡死
var lastInputTime = 0;
function onSearchChange(inputText){
	if(new Date().getTime() - lastInputTime >100){
		gameSearch(json, inputText, 5);
		//在这里处理结果
	}
	lastInputTime = new Date().getTime();
}
//游戏搜索方法，参数1 游戏的json，参数2 搜索的字符串，参数3 返回结果的最大个数，返回一个数组，有可能为空
function gameSearch(jsonStr, inputStr, maxCount){
	var searchedArr = Array();
	if(inputStr){
		var gameArr = eval('('+jsonStr+')'); 
		var gameArrCount = gameArr.length;
		var searchedCount = 0;
		for(i=0;i<gameArrCount;i++){
			if(gameArr[i]['name'].indexOf(inputStr) >= 0){
				searchedArr.push(gameArr[i]);
				searchedCount++;
			}
			if(searchedCount >= maxCount){
				break;
			}
		}
	}
		
	//test
	$("p").html("");
	if(searchedArr.length == 0){
		$("p").html("没有找到！");
	}else{
		for(i=0;i<searchedArr.length;i++){
			$("p").html($("p").html()+searchedArr[i]['name'] + "<br>");
		}
	}
	//test
	return searchedArr;
}
